import React from 'react'
import '../styles/Discussproject.css'

function Discussproject() {
  return (
    <div className='discussproject'>
        <h1 className='discussprojecttitle'>Want to discuss your project</h1>
        <h2 className='discussprojectdesc'>Lets join with us and turn your project idea into an <br/> amazing digital product</h2>
    </div>
  )
}

export default Discussproject
